}

pub fn arr_copy_slice<T, N, M>(src: [T; N], mut dst: [T; M], offset: u32) -> [T; M] {
    let iterator_len = if N > M { M } else { N };
    for i in 0..iterator_len {
        dst[i] = src[i + offset];
    }
    dst
}

